text:
Watching 
@MarthaRaddatz
 and 
@ThisWeekABC
 fully embrace the “do you want a living son or a dead daughter?” canard is one of the most shameful displays of journalistic activism I’ve seen. And when exactly did “trans kids” because the “soul” of our nation?

Producers and bookers for @ABC & @ThisWeekABC made the subjective choice to amplify this guy, even though he's got a fringe sliver of a following.
@MarthaRaddatz revealed as much in her first question.

There are only tabloidish reasons for this show to *gift* him amplification
